    public static Adres generateAdres(int id) {
        Adres adres = new Adres();

        adres.setAdresId(id);
        adres.setPostcode(getRandomPostCode());
        adres.setHuisnummer(getRandomHuisNummer());
        adres.setStraat(getRandomStraat());
        adres.setWoonplaats(getRandomWoonplaats());

        return adres;
    }

    public static void assertEquals(Adres expected, Adres actual) {
        assertAll(
                () -> Assertions.assertEquals(expected.getAdresId(), actual.getAdresId()),
                () -> Assertions.assertEquals(expected.getStraat(), actual.getStraat()),
                () -> Assertions.assertEquals(expected.getHuisnummer(), actual.getHuisnummer()),
                () -> Assertions.assertEquals(expected.getPostcode(), actual.getPostcode()),
                () -> Assertions.assertEquals(expected.getWoonplaats(), actual.getWoonplaats())
        );
    }

    private static String getRandomPostCode() {
        int number = random.nextInt(9999) + 1;
        return String.format("%04d%c%c" , number, alphabet.charAt(random.nextInt(alphabet.length())), alphabet.charAt(random.nextInt(alphabet.length())));
    }

    private static String getRandomWoonplaats() {
        return woonplaatsen[random.nextInt(woonplaatsen.length)];
    }

    private static String getRandomStraat() {
        return streetNames[random.nextInt(streetNames.length)];
    }

    private static String getRandomHuisNummer() {
        String number = Integer.toString(random.nextInt(999) + 1);
        if (random.nextBoolean()) {
            number += alphabet.charAt(random.nextInt(alphabet.length()));
        }

        return number;
    }


    private static String getRandomTussenvoegsel() {
        return Character.toString(alphabet.charAt(random.nextInt(alphabet.length())));
    }
